import React, { useState } from 'react';
import PatternLearningFeedback from './PatternLearningFeedback';

function App() {
  const [serverUrl, setServerUrl] = useState('http://localhost:8000');
  const [caseId, setCaseId] = useState('54820');

  return (
    <div style={{ maxWidth: 1100, margin: '40px auto', padding: 24, background: '#fff', borderRadius: 12, boxShadow: '0 2px 12px #0001' }}>
      <div style={{ display: 'flex', justifyContent: 'center', marginBottom: 24 }}>
        <button
          style={{
            padding: '10px 32px',
            background: '#6c47ff',
            color: '#fff',
            border: 'none',
            borderRadius: 6,
            fontWeight: 'bold',
            cursor: 'pointer'
          }}
          disabled
        >
          ðŸ§  Pattern Learning Dashboard
        </button>
      </div>
      <div style={{ display: 'flex', gap: 16, marginBottom: 24 }}>
        <div>
          <label>Server URL:</label>
          <input
            type="text"
            value={serverUrl}
            onChange={e => setServerUrl(e.target.value)}
            style={{ marginLeft: 8, width: 250 }}
          />
        </div>
        <div>
          <label>Case ID:</label>
          <input
            type="text"
            value={caseId}
            onChange={e => setCaseId(e.target.value)}
            style={{ marginLeft: 8, width: 120 }}
          />
        </div>
      </div>
      <PatternLearningFeedback serverUrl={serverUrl} caseId={caseId} />
    </div>
  );
}

export default App;
